import Business from './pages/Business.js';
import './App.css';
import Navbar from './components/Navbar';
import { BrowserRouter,Route } from 'react-router-dom'


function App() {
  return (
    <div>
      <BrowserRouter>
      <Navbar/> 
      <Route exact path="/Business" component={Business} />
      <Route exact path="/Business" component={Business} />
      <Route exact path="/Business" component={Business} />
      <Route exact path="/Business" component={Business} />
      <Route exact path="/Business" component={Business} />
      <Route exact path="/Business" component={Business} />
      <Route exact path="/Business" component={Business} />
      </BrowserRouter>
    </div>
  );
}

export default App;
